import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one "Add to Cart" button to appear (by class)
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // Get all visible "Add to Cart" buttons
    const addToCartButtons = await page.$$('.add-to-cart');

    // Rapidly click the first 3 "Add to Cart" buttons, 5 times each (simulate stress)
    const clickCount = 5;
    const maxButtons = Math.min(3, addToCartButtons.length);

    for (let i = 0; i < maxButtons; i++) {
      for (let j = 0; j < clickCount; j++) {
        await addToCartButtons[i].click();
      }
    }

    // Take screenshot after rapid add-to-cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_rapid_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_rapid_add.png'));

    // Open the cart modal (click on cart div)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear (look for cartItems or cartModal)
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Extract cart item titles and quantities
    let extractedData = {};
    try {
      await page.waitForSelector('.cart-item', { timeout: 5000 });
      const cartItems = await page.$$('.cart-item');
      const items = [];
      for (const item of cartItems) {
        const title = await item.$eval('.cart-item-title', el => el.textContent.trim());
        const quantity = await item.$eval('.quantity', el => el.textContent.trim());
        items.push({ title, quantity });
      }
      extractedData.cartItems = items;
    } catch (e) {
      extractedData.cartItems = [];
    }

    // Rapidly remove all items from cart (click all "Remove" buttons)
    const removeButtons = await page.$$('.remove-item');
    for (const btn of removeButtons) {
      await btn.click();
    }

    // Take screenshot after removals
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    // Extract cart modal text to verify it's empty
    let cartEmptyText = '';
    try {
      cartEmptyText = await page.$eval('.empty-cart', el => el.textContent.trim());
    } catch (e) {
      cartEmptyText = '';
    }
    extractedData.cartEmptyText = cartEmptyText;

    return {
      success: true,
      action: "Performed rapid add-to-cart and removal stress test, verified cart contents and empty state.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
